import { FaGithub, FaGlobe } from "react-icons/fa"
import Chip from "./Chip"
import SectionTitle from "./SectionTitle"

const projects = [
    {
        title: "Jetly Blog & Magazine WordPress Theme",
        description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec hendrerit, quam vitae ornare sagittis, dui ligula tempor urna, ac varius nisl dolor sit amet mi. Vestibulum convallis felis maximus, ullamcorper dui vel, laoreet elit. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer dictum tempor sodales.",
        image: "https://cdn.dribbble.com/users/8801773/screenshots/16252949/media/18f99ebc08d4fa2acee259f0ffe8c695.jpg",
        chips: [
            "WordPress",
            "Custom Theme"
        ],
        links: [
            {
                icon: <FaGithub />,
                url: "https://github.com/"
            },
            {
                icon: <FaGlobe />,
                url: "https://demo.temajet.com/"
            }
        ]
    },
    {
        title: "Jetly Blog & Magazine WordPress Theme",
        description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec hendrerit, quam vitae ornare sagittis, dui ligula tempor urna, ac varius nisl dolor sit amet mi. Vestibulum convallis felis maximus, ullamcorper dui vel, laoreet elit. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer dictum tempor sodales.",
        image: "https://cdn.dribbble.com/users/8801773/screenshots/16252949/media/18f99ebc08d4fa2acee259f0ffe8c695.jpg",
        chips: [
            "WordPress",
            "Custom Theme"
        ],
        links: [
            {
                icon: <FaGithub />,
                url: "https://github.com/"
            },
            {
                icon: <FaGlobe />,
                url: "https://demo.temajet.com/"
            }
        ]
    }
]

function Project() {
    return (
        <div className="container mx-auto">
            <SectionTitle>Projects</SectionTitle>
            {
                projects.map((project, index) => {
                    return (
                        <div className="project flex justify-between odd:flex-row-reverse items-center h-full mb-24">
                            <div className="project-image w-[49%]">
                                <img
                                    className="w-full h-[400px] object-cover rounded-lg"
                                    src={project.image}
                                    alt={project.image} />
                            </div>
                            <div className="project-text p-12 h-full relative w-[100%] lg:w-[49%] rounded-md bg-indigo-50 duration-300">
                                <h3 className="font-semibold text-2xl mb-4">Jetly Blog & Magazine WordPress Theme</h3>
                                <p className="mb-6">
                                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec hendrerit, quam vitae ornare sagittis, dui ligula tempor urna, ac varius nisl dolor sit amet mi. Vestibulum convallis felis maximus, ullamcorper dui vel, laoreet elit. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer dictum tempor sodales.
                                </p>
                                <div className="mb-2">
                                    <Chip>Reactjs</Chip>
                                    <Chip>Ant Design</Chip>
                                </div>
                                <div className="flex">
                                    <a href="https://github.com/"><FaGithub className="text-xl text-indigo-700 mr-3" /></a>
                                    <a href="https://demo.temajet.com/demo/"><FaGlobe className="text-xl text-indigo-700" /></a>
                                </div>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Project
